        }
        .header img{
            width: 226px;
            height: 69px;
        }
        .titles{
            line-height: 20px;
        }
        .title1 {
            margin-top: 44px;
            margin-left: 70px;
        }
        .title1 img{
            width: 116px;
            height: 65px;
        }
        .title2{
            font-size: 70px;
            color: #e6281e;
            font-weight: bolder;
            margin-left: 70px;
        }

            margin-top: 23px;

            width: 317px;
            height: 40px;

            margin-top: 15px;
            width: 40%;

        .row p {
            margin: 0px;
        }
        .card {
            padding: 4px 8px;
        }
        .--fecha {
            background: #ffbf00;
            display: flex;
            border-radius: 5px;
            margin-top: 21px;
            margin-left: 70px;
            color: #fff;
            width: 323px;
            height: 25px;
        }
        .icono img {
            width: 15px;
            height: 15px;
            margin-top: 1.5px;
            margin-right: 10px;
        }
        .card .title-card {
            margin-right: 5px;
        }
        .--hora {
            background: #7bc949;
            display: flex;
            border-radius: 5px;
            margin-top: 7px;
            margin-bottom: 7px;
            margin-left: 70px;
            color: #fff;
            width: 323px;
            height: 25px;
        }
        .--plataforma {
            background: #5f00d0;
            display: flex;
            border-radius: 5px;
            margin-left: 70px;
            color: #fff;
            width: 323px;
            height: 25px;
        }
        .row2 {
            margin-left: 70px;
            margin-top: 21px;
        }
        .row2 img{
            width: 256px;
            height: 72px;
        }
        .row3 {
            margin-left: 70px;
            margin-top: 35px;
            margin-bottom: 35px;
        }
        .row3 img {
            width: 182px;
            height: 35px;
        }
        .footer {
            position: relative;
        }
        .line img{
            position: absolute;
            bottom: 0px;
            width: 100%;
            height: 194px;
        }
        .persona img {
            position: absolute;
            top: -652px;
            right: 0px;
